  /**
   * lấy thông tin bill theo bàn
   * @param table : bàn đã chọn
   */


  getBillByTable(table) {
    this.listTables = this.listTables.map(item => {
      if (item._id == table._id) item.selected = true;else item.selected = false;
      return Object.assign({}, item);
    });
    this.selectedTableID = table._id; // get bill lưu tạm của bàn về

    this.vhQueryCafe.getBills_byFields({
      id_table: {
        $eq: table['_id']
      },
      bill_type: {
        $eq: 5
      },
      id_branch: {
        $eq: this.vhQueryCafe.getDefaultBranch()._id
      }
    }).then(bills => {
      // lấy bill mới nhất
      bills = this.vhAlgorithm.sortDatebyDESC(bills, 'date');

      if (bills[0]) {
        this.selectedBill = bills[0];
        this.onChangeInvoiceSelected(); // nếu bàn trắng mà get dc bill thì chuyển lại sang xanh

        if (!table.status) {
          this.vhQueryCafe.updateTable(table._id, {
            status: true
          });
        }
      } else {
        // nếu bàn đang xanh mà ko có bill thì báo lỗi để user reset hoặc liên hệ CSKH
        if (table.status) {
          this.vhComponent.alertConfirm("Lỗi", "Lỗi truy vấn hóa đơn", "Đã xảy ra lỗi trong quá trình truy vấn hóa đơn, vui lòng thử lại sau!!!");
          this.error_to_get_bill = true; // gán thành true để ở component app-invoice-detail hiển thị thông báo

          this.vhQueryCafe.updateTable(table._id, {
            status: false
          }).then(() => {
            this.listTables = this.listTables.map(item => {
              if (item._id == table._id) item.status = false;
              return Object.assign({}, item);
            });
            this.selectedBill = null;
            this.error_to_get_bill = false;
          });
        } else {
          this.selectedBill = null;
          this.onChangeInvoiceSelected();
        }
      }
    }).catch(err => {
      console.error(err);
    });
  }
