  /**
   * Lấy danh sách hoá đơn booking theo ngày
   * @param startDate ngày bắt đầu
   * @param endDate ngày kết thúc
   * @param type key để đếm số lượng hoá đơn. VD: overdue, upcoming, Monday, ...
   */


  bookingGetDataByDate(startDate, endDate, type) {
    const query = {
      bill_type: {
        $eq: 17
      },
      id_branch: {
        $eq: this.vhQueryCafe.getDefaultBranch()._id
      }
    };

    if (type === 'overdue') {
      query.date = {
        $lte: new Date(new Date(startDate).setHours(0, 0, 0, 0))
      };
    } else if (type === 'upcoming') {
      // 2 giờ sau
      const now = new Date();
      query.date = {
        $gte: new Date(new Date(startDate).setHours(now.getHours(), now.getMinutes(), now.getSeconds())),
        $lte: new Date(new Date(startDate).setHours(now.getHours() + 2, now.getMinutes(), now.getSeconds()))
      };
    } else if (startDate && endDate) {
      query.date = {
        $gte: new Date(new Date(startDate).setHours(0, 0, 0, 0)),
        $lte: new Date(new Date(endDate).setHours(23, 59, 59, 999))
      };
    }

    this.vhComponent.showLoading('', 'transparent-loading').then(() => {
      this.vhQueryCafe.getBills_byFields(query, {}, {
        date: 1
      }, 0).then(bills => {
        this.vhComponent.hideLoading(0).then(() => {
          this.bookingListBills = this.bookingListBillsShow = bills;
          this.isLoadedBookingListBills = true; // cập nhật số lượng hoá đơn

          if (!startDate && !endDate) {
            this.countBookingBill();
          } else if (type === 'overdue') {
            this.bookingCountBill['overdue'] = this.countBillByDate(this.daysList[0].date, 'overdue');
          } else if (type === 'upcoming') {
            this.bookingCountBill['upcoming'] = this.countBillByDate(this.daysList[0].date, 'upcoming');
          } else if (type === 'custom') {
            this.bookingCountBill['custom'] = this.bookingListBills.length || '0';
          }
        });
      }).catch(err => {
        this.vhComponent.hideLoading(0);
        console.error(err);
      });
    });
  }
