  /**
   * Tạo danh sách 7 ngày từ hôm nay
   */


  generateNext7Days() {
    const daysOfWeek = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
    const today = new Date();
    this.daysList = Array.from({
      length: 7
    }, (_, i) => {
      const date = new Date(today);
      date.setDate(today.getDate() + i);
      return {
        dayOfWeek: daysOfWeek[date.getDay()],
        date: date,
        count: 0
      };
    });
    this.daysList[0].dayOfWeek = 'Today';
    this.daysList[1].dayOfWeek = 'Tomorrow';
  }
  /**
   * Đếm số lượng hóa đơn theo ngày
   * @param date Ngày cần đếm
   * @param type Loại hóa đơn: 'upcoming' - hóa đơn sắp đến trong 2 giờ, 'overdue' - hóa đơn quá giờ, 'all' - tất cả hóa đơn
   */


  countBillByDate(date, type = 'all') {
    const now = new Date();
    const dateString = date.toISOString().split('T')[0];
    this.bookingListIdBillsOverdue = [];
    return this.bookingListBills.filter(bill => {
      const billDate = new Date(bill.date);
      const billDateString = billDate.toISOString().split('T')[0]; // Lấy danh sách Quá giờ

      const isOverdue = billDate.getTime() < now.getTime() || billDateString < dateString;

      if (isOverdue) {
        this.bookingListIdBillsOverdue.push(bill._id);
      }

      if (type === 'upcoming') {
        return billDateString === dateString && billDate.getTime() > now.getTime() && billDate.getTime() <= now.getTime() + 2 * 60 * 60 * 1000 // 2 giờ kế
        ;
      } else if (type === 'overdue') {
        return isOverdue;
      } else {
        return billDateString === dateString;
      }
    }).length || '0';
  }
